:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, James Nelson and BEETHAM, Mary-Margaret
  JWILLIAMS, Heathcote Beetham and MYHILL, Mary Anderson (Molly)
  IWILLIAMS, Heathcote Beetham (Bill) and NOLAN, Patricia Elizabeth
  WILLIAMS, Hamish Beetham Nolan and BEAMISH, Angela
  days anderson M91beth
  03> WILLIAMS, Hamish Beetham Nolan m on 30.06.1979 to BEAMISH, Angela
  b 05.09.1952
  b 27.08.1956
  Hamish b. at Gisborne and m. at Crownthorpe, Hastings. Angela, d/o Michael
  Beamish and Patricia Holden, b, at Crownthorpe. Address: "Turihaua", RD 3,
  Whangara, Gisborne.
  Hamish was educated at Hereworth School and then at Christ's College (house
  prefect, captain of gymnastic team, member of swimming team). After leaving
  school he gained practical farming experience at "Thungia" Station and
  Turanganui Romney Stud before purchasing "Maungaorangi" Station, 50 minutes north of Gisborne. He
  farmed and developed the property for 18 years before selling. In 1986 he moved with his family to
  "Turihaua" Station to run the property for family members. He also supervises "Ohinewairau" Station, a
  family property in Taihape, and is a director for Williams and Kettle and for several family companies.
  The Angus Stud is his passion and he enjoys the challenge that the stud stock industry demands. He
  maintains a keen interest in the sheep, deer and bloodstock industries. He is a strong believer in
  'sustainable farming practices' and has established plantings of various tree species for land erosion,
  timber and fodder crops.
  Hamish is involved in the Farm Cadet Scheme (now known as AITO), and with the New Zealand Beef Council
  at a local level. He is also a Councillor for the New Zealand Angus Association.
  Angela was educated at Woodford House and is a qualified speech and language therapist. She is
  directly involved in farming affairs and the Stud and is actively involved in the education of their
  three children.
  01> WILLIAMS, Toby Heathcote Beetham
  b 23.12.1980
  Toby b, at Gisborne. He attended Wainui Beach School, Gisborne, and Hereworth
  School and is now in his last year at Christ's College where he is a house prefect.
  02> WILLIAMS, Belinda Patricia
  b 31.08.1982
  Belinda b. at Gisborne. She attended Wainui Beach School and Gisborne Intermediate
  and is now in her third year at Woodford House.
  *
  03> WILLIAMS, Paul Michael
  b 15.07.1985
  Paul b. at Gisborne. He attended Wainui Beach School and is now at Hereworth School
  where he is a school prefect and a member of the school ist soccer XI as well as a
  Havelock North representative player.
